import './App.css';
import {Row,Col,Container} from 'reactstrap';
import "bootstrap/dist/css/bootstrap.min.css";
import Navbar1 from './Navbar1';
import Component_2 from './Component_2';
import Component_3 from './Component_3';


function App() {
  return (
    <div >
      <Navbar1/>
      <Container>

      <Row>
        <Col>

        </Col>
      </Row>
      <Row>
        <Col>
        <Component_2/>
        </Col>
      </Row>
      <Row>
        <Col>
        <Component_3/>
        </Col>  
      </Row>

      </Container>
    </div>
  );
}

export default App;
